o','0','elementor_library','','0'), ('97','1','2020-06-18 08:43:35','2020-06-17 21:43:35','<h2>¿Qué es SIECONS?</h2>		\n							Herramienta capaz de controlar, presupuestar y gestionar la ejecución de una obra de construcción.\n							<a href=\"http://localhost/siecons/contacto\"><img width=\"620\" height=\"592\" src=\"http://localhost/siecons/wp-content/uploads/2020/07/INTALADOR-LOGO-01-e1596107130862.png\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/siecons/wp-content/uploads/2020/07/INTALADOR-LOGO-01-e1596107130862.png 620w, http://localhost/siecons/wp-content/uploads/2020/07/INTALADOR-LOGO-01-e1596107130862-300x286.png 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a>						\n														<a href=\"http://localhost/siecons/contacto\">CONTACTANOS!</a>\n																						<a href=\"http://localhost/siecons/contacto\">Programador </a>\n			<figure><img width=\"128\" height=\"128\" src=\"http://localhost/siecons/wp-content/uploads/2020/06/1470399662_Marketing.png\" alt=\"\" loading=\"lazy\" /></figure><h3><h2 data-elementor-setting-key=\"title\" data-pen-placeholder=\"Teclea aquí...\" style=\"font-family: Roboto, sans-serif; font-size: 25px; font-style: normal; font-weight: 600; color: rgb(97, 206, 112);\">MISION</h2></h3><p>Crear la mejor herramienta para presupuestación y control de obra, adaptable a las necesidades de los clientes.</p>		\n			<figure><img width=\"128\" height=\"128\" src=\"http://localhost/siecons/wp-content/uploads/2020/06/1470399671_SEO.png\" alt=\"\" loading=\"lazy\" /></figure><h3><h2 data-elementor-setting-key=\"title\" data-pen-placeholder=\"Teclea aquí...\" style=\"font-family: Roboto, sans-serif; font-size: 25px; font-style: normal; font-weight: 600; color: rgb(97, 206, 112);\">VISION</h2></h3><p>Tener nuestra primera sede fuera de Cuba para el 2022.</p>		\n			<figure><img width=\"150\" height=\"150\" src=\"http://localhost/siecons/wp-content/uploads/2020/08/ROMPECABEZAS_Mesa-de-trabajo-1-150x150.png\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/siecons/wp-content/uploads/2020/08/ROMPECABEZAS_Mesa-de-trabajo-1-150x150.png 150w, http://localhost/siecons/wp-content/uploads/2020/08/ROMPECABEZAS_Mesa-de-trabajo-1-570x570.png 570w, http://localhost/siecons/wp-content/uploads/2020/08/ROMPECABEZAS_Mesa-de-trabajo-1-380x380.png 380w, http://localhost/siecons/wp-content/uploads/2020/08/ROMPECABEZAS_Mesa-de-trabajo-1-285x285.png 285w\" sizes=\"(max-width: 150px) 100vw, 150px\" /></figure><h3><h2 data-elementor-setting-key=\"title\" data-pen-placeholder=\"Teclea aquí...\" style=\"font-family: Roboto, sans-serif; font-size: 25px; font-style: normal; font-weight: 600; color: rgb(97, 206, 112);\">VALORES</h2></h3><p><p style=\"font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-weight: 300; color: rgb(191, 191, 191); white-space: normal;\"><strong style=\"font-size: 15px;\">-</strong>Máxima calidad como meta</p><p style=\"font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-weight: 300; color: rgb(191, 191, 191); white-space: normal;\"><strong style=\"font-size: 15px;\">-</strong>Transparencia y Cultura Abierta&nbsp;</p><p style=\"font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-weight: 300; color: rgb(191, 191, 191); white-space: normal;\"><strong style=\"font-size: 15px;\">-</strong>Constancia</p><p style=\"font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-weight: 300; color: rgb(191, 191, 191); white-space: normal;\"><strong style=\"font-size: 15px;\">-</strong>Responsabilidad</p><strong style=\"font-size: 15px;\">-</strong>Transformación</p>		\n			<h2>OFRECEMOS</h2>		\n										<img width=\"300\" height=\"300\" src=\"http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-10-1-300x300.png\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-10-1-300x300.png 300w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-10-1-1024x1024.png 1024w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-10-1-150x150.png 150w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-10-1-768x768.png 768w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-10-1-1536x1536.png 1536w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-10-1-2048x2048.png 2048w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-10-1-570x570.png 570w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-10-1-380x380.png 380w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-10-1-285x285.png 285w\" sizes=\"(max-width: 300px) 100vw, 300px\" />											\n			<h2>TRABAJAR EN ENTORNOS BIM</h2>		\n		<p>Poseemos las herramientas para traducir el modelo 3D creado en programas de modelado BIM en la información necesaria, para crear el presupuesto de la Obra&nbsp;: Tablas, Medidas, <strong>etc..</strong>&nbsp;La información puede estar agrupada en niveles o generales.</p>		\n			<h2>Añade aquí tu texto de cabecera</h2>		\n										<img width=\"768\" height=\"464\" src=\"http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-11-768x464.png\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-11-768x464.png 768w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-11-300x181.png 300w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-11-1024x619.png 1024w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-11-1536x929.png 1536w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-11-2048x1238.png 2048w\" sizes=\"(max-width: 768px) 100vw, 768px\" />											\n			<h2>GESTIÓN DE OBRA​</h2>		\n		<p>Es una herramienta para ser utilizada por todos los actores de un proyecto y en todas las faces de la obra, desde el pre-proyecto hasta la entrega en mano.</p><p>Ideal para:  </p><p>OBRAS N