/h3><p><p style=\"font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-weight: 300; color: rgb(191, 191, 191); white-space: normal;\"><strong style=\"font-size: 15px;\">-</strong>Máxima calidad como meta</p><p style=\"font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-weight: 300; color: rgb(191, 191, 191); white-space: normal;\"><strong style=\"font-size: 15px;\">-</strong>Transparencia y Cultura Abierta&nbsp;</p><p style=\"font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-weight: 300; color: rgb(191, 191, 191); white-space: normal;\"><strong style=\"font-size: 15px;\">-</strong>Constancia</p><p style=\"font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-weight: 300; color: rgb(191, 191, 191); white-space: normal;\"><strong style=\"font-size: 15px;\">-</strong>Responsabilidad</p><strong style=\"font-size: 15px;\">-</strong>Transformación</p>		\n			<h2>OFRECEMOS</h2>		\n										<img width=\"300\" height=\"300\" src=\"http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-10-1-300x300.png\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-10-1-300x300.png 300w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-10-1-1024x1024.png 1024w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-10-1-150x150.png 150w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-10-1-768x768.png 768w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-10-1-1536x1536.png 1536w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-10-1-2048x2048.png 2048w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-10-1-570x570.png 570w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-10-1-380x380.png 380w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-10-1-285x285.png 285w\" sizes=\"(max-width: 300px) 100vw, 300px\" />											\n			<h2>TRABAJAR EN ENTORNOS BIM</h2>		\n		<p>Poseemos las herramientas para traducir el modelo 3D creado en programas de modelado BIM en la información necesaria, para crear el presupuesto de la Obra&nbsp;: Tablas, Medidas, <strong>etc..</strong>&nbsp;La información puede estar agrupada en niveles o generales.</p>		\n			<h2>Añade aquí tu texto de cabecera</h2>		\n										<img width=\"768\" height=\"464\" src=\"http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-11-768x464.png\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-11-768x464.png 768w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-11-300x181.png 300w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-11-1024x619.png 1024w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-11-1536x929.png 1536w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-11-2048x1238.png 2048w\" sizes=\"(max-width: 768px) 100vw, 768px\" />											\n			<h2>GESTIÓN DE OBRA​</h2>		\n		<p>Es una herramienta para ser utilizada por todos los actores de un proyecto y en todas las faces de la obra, desde el pre-proyecto hasta la entrega en mano.</p><p>Ideal para:  </p><p>OBRAS NUEVAS</p><p>REHABILITACIONES</p><p>OBRAS DE INFRAESTUCTURA</p><p><strong>etc......</strong></p>		\n										<img width=\"300\" height=\"300\" src=\"http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-09-2-300x300.png\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-09-2-300x300.png 300w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-09-2-1024x1024.png 1024w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-09-2-150x150.png 150w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-09-2-768x768.png 768w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-09-2-1536x1536.png 1536w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-09-2-570x570.png 570w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-09-2-380x380.png 380w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-09-2-285x285.png 285w, http://localhost/siecons/wp-content/uploads/2020/07/iconos-para-web-09-2.png 1810w\" sizes=\"(max-width: 300px) 100vw, 300px\" />											\n			<h2>EXPORTACIÓN EN VARIOS FORMATO ​</h2>		\n		<p>Herramienta creada para trabajar en colaboración con aplicaciones externas como: Project, Primavera, Excel, etc.</p><p>Permitiendo que la información Creada en Siecons puede ser exportada en varios formatos en función de sus necesidades</p>		\n			<h2>HERRAMIENTA PENSADA PARA:</h2>		\n				<figure><img src=\"http://localhost/siecons/wp-content/uploads/2020/07/personas-verdes_Mesa-de-trabajo-1-copia-2-6-150x150.png\" alt=\"personas verdes_Mesa de trabajo 1 copia 2\" /></figure><figure><img src=\"http://localhost/siecons/wp-content/uploads/2020/07/personas-verdes_Mesa-de-trabajo-1-copia-3-6-150x150.png\" alt=\"personas verdes_Mesa de trabajo 1 copia 3\" /></figure><figure><img src=\"http://localhost/siecons/wp-content/uploads/2020/07/personas-verdes_Mesa-de-trabajo-1-copia-4-6-150x150.png\" alt=\"personas verdes_Mesa de trabajo 1 copia 4\" /></figure><figure><img src=\"http://localhost/siecons/wp-content/uploads/2020/07/personas-verdes_Mesa-de-trabajo-1-copia-5-6-150x150.png\" alt=\"personas verdes_Mesa de trabajo 1 copia 5\" /></figure><figure><img src=\"http://localhost/siecons/wp-content/uploads/2020/07/personas-verdes_Mesa-de-trabajo-1-copia-6-6-150x150.png\" alt=\"personas verdes_Mesa de trabajo 1 copia 6\" /></figure><figure><img src=\"http://localhost/siecons/wp-content/uploads/2020/07/personas-verdes_Mesa-de-trabajo-1-copia-11-150x150.png\" alt=\"personas verdes_Mesa de trabajo 1 copia\" /></figure><figure><img src=\"http://localhost/siecons/wp-content/uploads/2020/